import React from 'react';
import Sidebar from './Sidebar';
import SidebarRight from './SidebarRight';
import Homediv from './Homediv';
import Header from './Header';   

function App(){
    var array = ["#4CB3CF" , "#21ccaf" , "#5E8B7E" , "#39A6A3"  ,"#21ccaf" , "#DEEEEA"];
    return (
        <div>   
        <div>
        <Header />
        </div>     
        <div id="content">
            <Sidebar />
            <SidebarRight />
            <Homediv cname="hdiv1" cont="Home" bgcolor = "#4CB3CF"/>
            <Homediv cname="hdiv2" cont="Materials" bgcolor = "#21ccaf"/>
            <Homediv cname="hdiv1" cont="Courses" bgcolor = "#5E8B7E"/>
            <Homediv cname="hdiv2" cont="Softwares" bgcolor = "#39A6A3"/>
            <Homediv cname="hdiv1" cont="Internships" bgcolor = "#21ccaf"/>
            <Homediv cname="hdiv2" cont="Career" bgcolor = "#DEEEEA"/>
            </div>
        </div>);
}

export default App;
 // color2 : #5E8B7E
 // color3 : #39A6A3
 // color4 : #DEEEEA
